import React from 'react'
import './assets/css/base/base.css'
import Home from './paginas/Home'
import Sobre from './paginas/Sobre'

function App() {
  const Router = () => {
    const locartion = window.location.pathname
    if(location === '/sobre')
      return <Sobre/>
    else
      return <Home/>
  }
  return (
  <>
    <Home/>
    <Sobre/>
  </>
  )
}

export default App
